Real World SharePoint 2010

Proven real-world best practices from leading Microsoft SharePoint MVPs
SharePoint enables Web sites to host shared workspaces and is a leading solution for Enterprise Content Management.

The newest version boasts significant changes, impressive enhancements, and new features, requiring developers and administrators of all levels of experience to quickly get up to speed on the latest changes. This book is a must-have anthology of current best practices for SharePoint 2010 from 20 of the top SharePoint MVPs. They offer insider advice on everything from installation, workflow, and Web parts to business connectivity services, Web content management, and claims-based security.

SharePoint 2010 boasts significant updates, new features, and numerous changes and this comprehensive overview gets you up to speed on all the latest enhancements

